public class Main3 {
    public static void main(String[] args) {
        String s = "";
        System.out.println(longestDupSubstring(s));
    }

    public static String longestDupSubstring(String S) {
        char[] chars = S.toCharArray();
        List<String> list = new ArrayList<>(S.length());
        for (int i =0;i<S.length();i++) {
            list.add(new String(Arrays.copyOfRange(chars,i,chars.length)));
        }
        Collections.sort(list);
        String ret = "";
        for (int i = 0; i < list.size()-1; i++) {
            String tmp = lcp(list.get(i), list.get(i + 1));
            if(tmp.length()>ret.length())ret = tmp;
        }
        return ret;
    }

    private static String lcp(String s1, String s2) {
        int len = Math.min(s1.length(), s2.length());
        for (int i = 0; i < len; i++) {
            if (s1.charAt(i) != s2.charAt(i)) {
                return s1.substring(0, i);
            }
        }
        return s1.length()<=s2.length()?s1:s2;
    }





}
